        public LexicalAnalyzer(TextReader code, Environment environment)
        {
            dataStream = code;

            lexData = new char[BuffSize];
            int readBytes = dataStream.Read(lexData, 0, lexData.Length - 1);
            lStart = 0;
            fileOffset = 0;
            if (readBytes == lexData.Length - 1)
                lexData[readBytes] = reloadChar;
            else
                lexData[readBytes] = eof;
            env = environment;
            //fill mark states with mark code indices
            DFAMarkState mState;
			        }


