        public Terminal GetToken()
        {
            //buffer state variables
            int lexForward = lStart;
            int lexEnd = lStart;
            //state variables of dfa table
            int state = 1;
            int nextstate = 1;
            int curAcceptingState = 0;

            do
            {
                Terminal tok = new Terminal();
                state = nextstate;
                byte groupId = charConvMap[lexData[lexForward++]];
                nextstate = DFATable[state, groupId];
                //lexForward now points to the first nontested place
                if (nextstate == reloadState)
                {
                    Debug.Assert(lexForward == lexData.Length, "invalid position for reload character");
                    //we reached end of buffer 
                    //try to reload the buffer

                    //reposition data
                    Array.Copy(lexData, lStart, lexData, 0, lexForward - lStart);
                    //update buffer state variables
                    lexEnd = lexEnd - lStart;
                    //the -1 is to compensate for the additional eof char
                    lexForward = lexForward - lStart - 1;
                    lStart = 0;
                    //fill the remaining of the array except the last element
                    int readBytes = dataStream.Read(lexData, lexForward, lexData.Length - lexForward - 1);
                    //put reloadChar after read data
                    //if buffer is full put reloadChar
                    //else put eof
                    if (lexForward + readBytes >= lexData.Length - 1)
                        lexData[lexForward + readBytes] = reloadChar;
                    else
                        lexData[lexForward + readBytes] = eof;
                    //correct next state
                    byte groupId1 = charConvMap[lexData[lexForward++]];
                    nextstate = DFATable[state, groupId1];
                }
                else if (dfaList[nextstate].Type == DFAStateTypes.NORMAL)
                {
                    //continue looping
                }
                else if (dfaList[nextstate].Type == DFAStateTypes.ACCEPTING)
                {
                    //update curAccepting state
                    curAcceptingState = nextstate;
                    //update lEnd to point at the next place not tested
                    lexEnd = lexForward;
                }
                else if (nextstate == 0 /*|| (nextstate == reloadState && state == curAcceptingState &&lexForward < lexData.Length )*/)
                {
                    //search process ended
                    IDFAAcceptingState aState = (IDFAAcceptingState)dfaList[curAcceptingState];

                    //prepare user variables lexEnd,lexStart
                    int lexStart = lStart;

                    //update state variables lStart
                    lStart = lexEnd;
                    //update lineNo
                    tok.LineNo = lineNo;
                    for (int k = lexStart; k < lexEnd; k++)
                    {
                        if (lexData[k] == '\r')
                            lineNo++;
                    }
                    tok.FileOffset = fileOffset;
                    fileOffset += (lexEnd - lexStart);
                    //perform user operation
                    switch (aState.CodeIndex)
                    {
						case 0:
                            
							//in the case of error lexEnd
