                else if (dfaList[nextstate].Type == DFAStateTypes.MARK)
                {
                    DFAMarkState curState = (DFAMarkState)dfaList[nextstate];
                    for (int i = 0; i < curState.MarkCodeIndices.Length; i++)
                    {
